    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 73 NOT IN ( - col1, 88 * - - col2 * + + col0 - 52 + - 71 );
  - name: tab1

outputs:
  - name: q10600.out
    data: |
      51	14	96
      85	5	59
      91	47	68
